import React from "react";

function NewItemPopup({ setPopupShown }) {
  //   const isShown = false;

  return (
    <div class="new-item-popup">
      <div className="popup-row">
        <p>Notebook</p>
      </div>
      <div className="popup-row"  onClick={() => setPopupShown(BOOLEAN.true)}>
        <p>Dataset</p>
      </div>
      <div className="popup-row">
        <p>Chart</p>
      </div>
    </div>
  );
}

export default NewItemPopup;
